HAMMOND – Southeastern Louisiana University celebrated its graduates Saturday, Dec. 9, in two separate commencement ceremonies in the University Center.

Southeastern graduates included 354 men and 687 women, who were receiving 15 different degrees and representing 30 states and 15 countries. Candidates for associate, bachelor’s, master’s and doctoral degrees were honored.

Louisiana First Circuit Court of Appeal Judge Allison H. Penzato served as guest speaker for both ceremonies. A native of Bogalusa, Penzato graduated from Bogalusa High School. She received her undergraduate degree from Southeastern, majoring in government, and studied law at Loyola Law School, graduating in 1981. While in law school, Judge Penzato served as law clerk to United States Magistrate Ingard O. Johannesen. After practicing law for 26 years, she was first elected to the 22nd Judicial District Court in 2008 and served as Chief Judge from 2014-2016. Judge Penzato was elected to the First Circuit Court of Appeal in 2017.

The university awarded its highest academic honor, the President’s Medal for Academic Excellence, to 6 students with the highest cumulative grade point average in the university’s five colleges.

Medal recipients were:

▪ College of Arts, Humanities and Social Sciences – art major Aileigh Zarin Simmons of Hammond.

▪ College of Business – management major Maddison Oakes of Holden and accounting major Abigail Malynne Wheat of Livingston.

▪ College of Education – early childhood education major, Claire Isabella Bates of St. Amant.

▪ College of Nursing and Health Sciences – kinesiology major Mitchell Clark Curry of Greensburg.

▪ College of Science and Technology – biology major Madison Elizabeth Ellender of Houma.

